const e=JSON.parse('{"key":"v-06a04512","path":"/lc3192.html","title":"3192. 使二进制数组全部等于 1 的最少操作次数 II","lang":"en-US","frontmatter":{"tag":"贪心"},"headers":[],"git":{"createdTime":1729348236000,"updatedTime":1729348236000,"contributors":[{"name":"HouShengming","email":"18865290907@163.com","commits":1}]},"readingTime":{"minutes":0.65,"words":195},"filePathRelative":"lc3192.md","localizedDate":"October 19, 2024","excerpt":"<h1> 3192. 使二进制数组全部等于 1 的最少操作次数 II</h1>\\n<p>给你一个二进制数组 <code>nums</code> 。</p>\\n<p>你可以对数组执行以下操作 <code>任意</code> 次（也可以 <code>0</code> 次）：</p>\\n<p>选择数组中 <code>任意</code> 一个下标 <code>i</code> ，并将从下标 <code>i</code>开始一直到数组末尾 所有 <code>元素</code> 反转 。\\n反转 一个元素指的是将它的值从 <code>0</code> 变 <code>1</code> ，或者从 <code>1</code> 变 <code>0</code> 。</p>"}');export{e as data};
